  false,\n\t\"url\": null,\n\t\"notes\": \"Integrated Ocean and Coastal Mapping Product
  (IOCM). The images were acquired from a nominal altitude of 7,500 feet above ground
  level (AGL), using an Applanix Digital Sensor System (DSS). Imagery products are
  true color (RGB) and infrared (IR) images. Images have been orthorectified and mosaiced
  to produce a seamless data set. For information about combining the IR image and
  the RGB image into a 4 band NIR image, please download the IOCM Band Stack Guide
  document at this link: ftp://coast.noaa.gov/temp/metadata_supp\",\n\t\"owner_org\":
